    render(){
        return(
            <div className="landing-page" id="landing" style={{width:'100%',margin:'0px'}}>
                {/* <h1 class="imgtext">Hi, <br /> I am Saket</h1> */}
                <p className="resume-text"><a href={Resume} style={{color:'black'}} target="blank">VIEW RESUME</a></p>
            </div>
        )
    }
}
